Join the SoCal Nuclear Bombshells + Friends for an evening of horror and hedonism to kick off your holiday season! 

We will be bringing you Cabaret and  burlesque review with a healthy helping of our signature 'weird barbie' energy - because here at Bombshell HQ, we do the weird stuff!

- Do some holiday shopping by supporting our local small business vendors on the patio!
- Get your fortune read by Daddy Heda and her bag of bones!
- Stay after the show for karaoke with the Bombshells!

7pm - Doors open
7:15pm - Burlesque Floor Show
9pm - Karaoke

